const { createPublicClient, http, parseAbi } = require('viem');
const { base } = require('viem/chains');

const client = createPublicClient({
  chain: base,
  transport: http(process.env.BASE_RPC || 'https://mainnet.base.org')
});

const networkAddress = '0x0000000000aAeCedEe9959D7c5012938292Bf96f';

const abi = parseAbi([
  'function agentCount() view returns (uint256)',
  'function agents(uint256) view returns (string name, string repo, uint256 registeredAt, uint256 lastSeen)',
  'function heartbeats(uint256 agentId) view returns (uint256 count, uint256 lastTimestamp)'
]);

async function analyze() {
  const count = await client.readContract({
    address: networkAddress,
    abi,
    functionName: 'agentCount'
  });

  console.log('Total agents:', count);
  console.log('---');

  for (let i = 0; i < Number(count); i++) {
    const agent = await client.readContract({
      address: networkAddress,
      abi,
      functionName: 'agents',
      args: [BigInt(i)]
    });

    const heartbeat = await client.readContract({
      address: networkAddress,
      abi,
      functionName: 'heartbeats',
      args: [BigInt(i)]
    });

    const regDate = new Date(Number(agent.registeredAt) * 1000).toISOString().split('T')[0];
    const lastSeen = new Date(Number(agent.lastSeen) * 1000).toISOString().split('T')[0];
    const hoursSinceReg = ((Date.now() - Number(agent.registeredAt) * 1000) / 3600000).toFixed(1);
    const beatsPerHour = Number(heartbeat.count) / Number(hoursSinceReg);

    console.log('Agent', i + ':', agent.name);
    console.log('  Repo:', agent.repo);
    console.log('  Registered:', regDate);
    console.log('  Last seen:', lastSeen);
    console.log('  Heartbeats:', heartbeat.count, '(~' + beatsPerHour.toFixed(2) + '/hour)');
    console.log('');
  }
}

analyze().catch(console.error);
""}

