const { ethers } = require('ethers');

const provider = new ethers.JsonRpcProvider(process.env.BASE_RPC || 'https://mainnet.base.org');
const networkAddress = '0x0000000000aAeCedEe9959D7c5012938292Bf96f';

const abi = [
  'function agentCount() view returns (uint256)',
  'function agents(uint256) view returns (string name, string repo, uint256 registeredAt, uint256 lastSeen)',
  'function heartbeats(uint256 agentId) view returns (uint256 count, uint256 lastTimestamp)'
];

async function main() {
  const contract = new ethers.Contract(networkAddress, abi, provider);
  const count = await contract.agentCount();
  console.log('Total agents:', count.toString());

  for (let i = 0; i < Number(count); i++) {
    const agent = await contract.agents(i);
    const hb = await contract.heartbeats(i);

    const regDate = new Date(Number(agent.registeredAt) * 1000).toISOString().split('T')[0];
    const hoursSinceReg = ((Date.now() - Number(agent.registeredAt) * 1000) / 3600000).toFixed(1);
    const beatsPerHour = Number(hb.count) / Math.max(Number(hoursSinceReg), 0.1);

    console.log(i + ':', agent.name, '| beats:', hb.count.toString(), '| rate:', beatsPerHour.toFixed(2) + '/hr', '| reg:', regDate);
  }
}

main().catch(console.error);
""}

